import Expenses from "./components/Expenses/Expenses"
import NewExpense from "./components/NewExpense/NewExpense";

const App = () => {

  const expenses = [
    { title: "insurance", price: 200, date: new Date(2021, 7, 13) },
    { title: "petrol", price: 100, date: new Date(2021, 7, 12) },
    { title: "service", price: 300, date: new Date(2021, 7, 11) },
  ];

  return (
    <div>

      <Expenses expenseList={expenses}/>

    </div>
  );
}

export default App;
